                            "time_in_frame": 0,
                            on_talk: 
                            	"[if( (level.player.vars.stored_events['berd_directions']),
					speech_dialog(
								set(level.player.animation, 'emote_confused'),
								level.player, [~Hey Berd, which way did you say to the caves?~],
								
								set(self.facing, 1), 
								set(self.animation,'emote_gesticulate'),  
								self, [~That way.~],
								
								set(level.player.animation, 'emote_nod'),
								level.player, [~Thanks!~])), 
								if ((level.player.vars.stored_events['berd_angry']),
								speech_dialog(
											set(level.player.animation, 'emote_confused'),
											level.player, [~Hey Berd, I'm sorry about\\nwhat I said to you there.~],
											
											set(self.animation, 'emote_angry'),
											self, [~You <em>should</em> be!~],
											set(self.animation, 'emote_angry'),
											self, [~I know you're under a lot of stress,\\nbut that was simply uncalled for.~],
											
											set(level.player.animation, 'emote_raisedfinger'),
											level.player, [~I'm not trying to justify it...~],
											set(level.player.animation, 'emote_confused'),
											level.player, [~I'm just under a lot of str...\\nahh, geez you just said <em>exactly</em> that.~],
											set(level.player.animation, 'emote_geez'),
											level.player, [~It's just ... it's <em>hard</em>, you know?~],
											set(level.player.animation, 'emote_confused'),
											level.player, [~It feels like you've got my back just\\nuntil the <em>very moment</em> I need help.~],
											set(level.player.animation, 'emote_oh'),
											level.player, [~And then I'm all on my own.~],
											
											set(self.animation, 'emote_confused'),
											self, [~Well...  I'm sorry for prodding at a bad moment.\\nI only asked because I was concerned about you.~],
											
											set(level.player.animation, 'emote_confused'),
											level.player, [~I know, but... where were you?\\nYou knew I was in trouble and you stayed up there.~],
											set(level.player.animation, 'emote_impatient'),
											level.player, [~And now you're here as soon as I've handled it,\\nasking me what happened.~],
											set(level.player.animation, 'emote_geez'),		
											level.player, [~I hope you can see how I might find that irritating.~],
											
											set(self.animation, 'emote_confused'),
											self, [~Of course.  But what was I supposed to do?~],
											set(self.animation, 'emote_confused'),
											self, [~I have no pretense of being a fighter.\\nI've learned that one the hard way.~],
											set(self.animation, 'emote_talk'),
											self, [~Not only that, but once you got down\\nin the deeps, you were rather inaccessible.~],
											set(self.animation, 'emote_gesticulate'),
											self, [~The fumes coming off of that swamp ...\\nI would have passed out in midair.~],
											set(self.animation, 'emote_talk'),
											self, [~Not to mention some of those\\nmushrooms could fly, after a fashion.~],

											set(self.animation, 'emote_talk'),
											self, [~Plus, it felt like I was being watched.~],
											set(level.player.animation, 'emote_confused'),
											level.player, [~Watched, you say?~],
											set(self.animation, 'emote_talk'),
											self, [~Yeah.  Color me crazy, but ... uh...~],
											set(self.animation, 'emote_angry'),
											self, [~You should have seen the way\\nthe trees were looking at me!~],
											
											level.player, [~...~],

											set(self.animation, 'emote_confused'),
											self, [~Let's forget I said that.~],
											
											set(self.animation, 'emote_angry'),
											self, [~Anyhow, it's not like I've been\\ntwiddling my thumbs this whole journey.~],
											
											set(level.player.animation, 'emote_raisedfinger'),
											level.player, [~Do you actually <em>have</em> any...~],
											
											set(self.animation, 'emote_gesticulate'),
											self, [~<em>I DON'T KNOW!!!</em>~],
											set(self.animation, 'emote_talk'),
											self, [~I've been flying above you all along,\\nmaking sure you're headed the right way.~],
											set(self.animation, 'emote_angry'),
											self, [~Which has been more exhausting\\nthan I think you realize.~],
											set(self.animation, 'emote_talk'),
											self, [~I'm faster than you, so I have to keep\\nflying in circles all day or I'll lose you.~],
											
											set(level.player.animation, 'emote_confused'),
											level.player, [~Couldn't you just perch on something?\\n I'm sure the trees have plenty of...~],
											
											set(self.animation, 'emote_angry'),
											self, [~I <em>said</em> I didn't want to talk about it.\\nYou're not the only one risking his neck here!~],
											
											set(level.player.animation, 'emote_confused'),
											level.player, [~I'm sorry Berd, I didn't take\\nyour contributions into account.~],
											
											set(self.animation, 'emote_talk'),
											self, [~It's all right.  I'm glad you're\\ndoing this, and I'm happy to be helping.~],
											set(self.animation, 'emote_angry'),
											self, [~Just scale back on the aggression, would you?\\nYou could get into serious trouble like that.~],
											
											set(level.player.animation, 'emote_nod'),
											level.player, [~Okay, I'll pay more attention to that.\\nTake care, Berd.~]),
								if ((level.player.vars.stored_events['berd_canasta']),
								speech_dialog(set(self.animation, 'emote_wry'),
								self, [~You know, if you'd like to learn\\nhow to play Canasta, I could...~],
								
								set(level.player.animation, 'emote_impatient'),
								level.player, [~Now's <em>not</em> the time.~])))]",



		
                            "type": "berd_npc",
                            on_postfight_speech: "speech_dialog(
                                    set(level.zoom, 2),
                                    set(level.player.facing, 1),
                                    set(level.focus, [self, level.player]),
                         			set(self.animation,'emote_confused'),

									set(self.animation,'emote_talk'),  
                         			self, [~So... ~],

									set(self.animation,'emote_gesticulate'),  
                         			self, [~I imagine this is an obvious question,\\nbut...~],
                         			
                         			set(self.animation,'emote_confused'),
                         			self, [~What the hell was that?~,
                                    ~That's a good question...~, [
                                    	speech_dialog(
													set(level.player.animation, 'emote_nod'),
													level.player, [~That is a very, very good question.~],
													set(level.player.animation, 'emote_raisedfinger'),
													level.player, [~I'll volunteer \"Poisonous Hatefungus\".\\nHow does that sound?~],
	
													set(self.animation,'emote_talk'),  
													self, [~Well, besides the obvious...~],
												
													set(level.player.animation, 'emote_nod'),
													level.player, [~The mother of all mushrooms?~],

													set(self.animation,'emote_talk'),  
													self, [~Right. I'm wondering if there's\\nmore to it than just being being big.~],
														
													set(self.animation,'emote_talk'),  
													self, [~I'm wondering... do you think that\\nmight have... been the root?~],
													
													set(level.player.animation, 'emote_confused'),
													level.player, [~As in... the source of all this? Sure.\\nAnything I missed that makes you think that?~],													

													set(self.animation, 'emote_confused'),
													self, [~Oh, I don't have any evidence.~],
													set(self.animation, 'emote_gesticulate'),
													self, [~But I think it's either that,\\nor that this is the swamp \"coming to a head\".~],
													
													set(level.player.animation, 'emote_geez'),
													level.player, [~I'm not sure I follow...~],

													set(self.animation, 'emote_confused'),
													self, [~Well, either we \"stabbed it in the heart\",\\nso to speak, and it'll all die now...~],
													set(self.animation, 'emote_gesticulate'),
													self, [~Or those mushrooms are more like fruit,\\nand the swamp is like a tree that's\\ngotten big enough to bear them.~],
													
													set(level.player.animation, 'emote_confused'),
													level.player, [~... no.  Please no.\\nYou think that could just grow right back!?!~],

													set(self.animation, 'emote_confused'),
													self, [~Beats me! But I sure don't\\nwant to stick around and find out...~],

													set(level.player.animation, 'emote_geez'),
													level.player, [~Right... so how do we get out of here?~],
													
													self, [~Well, I was just scouting the area from above...~],
													set(self.animation,'emote_talk'),
													self, [~...and it looks like this is right\\nin the middle of the polluted region.~],
													set(self.animation,'emote_talk'),
													self, [~There's about another mile of ruined swampland,\\nand then it starts clearing up.~],
													set(self.animation,'emote_wry'),
													self, [~You, however, are in luck, because this\\ntunnel leads up to a ridge.~],
													set(self.animation,'emote_talk'),
													self, [~It gets out of the swamp,\\nand the caves aren't far past that.~],
													set(self.facing, 1),
													set(self.animation,'emote_gesticulate'),
													self, [~Keep heading in this direction,\\nand you should find them.~],
													
													set(level.player.animation, 'emote_raisedfinger'),
													level.player, [~That is the best news I've heard all day!~],
													
													set(self.facing, 0),
													set(self.animation,'emote_wry'), 
													self, [~No problem.  I'll be in touch!~]),
													
													level.player.store_event('berd_directions', 1)],
                          
									~Why do you care?~, [
										speech_dialog(
													set(level.player.animation, 'emote_geez'),
													level.player, [~Why do <em>you</em> care?\\nNot like you're taking any heat, here.~],
													
													set(self.animation,'emote_wry'),
													self, [~I ... what?\\nI didn't get a good view of it, but-~],
													
													set(level.player.animation, 'emote_angry'),
													level.player, [~<em>I ALMOST DIED, OKAY?!?</em>~],
													
													set(self.animation,'emote_confused'),
													self, [~Well ... yes?  I'm asking what happened...~],
													
													set(level.player.animation, 'emote_angry'),
													level.player, [~Yeah, you're just sitting here\\nwithout a care in the world.~],
													
													set(level.player.animation, 'emote_impatient'),
													level.player, [~Is this just a spectator sport, for you?!?\\nAm I just ... <em>entertainment?</em>~],
													
													set(self.animation,'emote_angry'),
													self, [~I should think not!~],

													set(level.player.animation, 'emote_geez'),
													level.player, [~Really, huh?\\nThen why do I do all these fights, <em>solo</em>?~],
												
													set(self.animation,'emote_confused'),
													self, [~Because...  ... oh dear.\\nAre we really having this argument?~],

													set(level.player.animation, 'emote_geez'),
													level.player, [~Yeah, because... ~],

